import "./App.css";
import Header from "./components/Header";
import {Routes ,Route } from "react-router-dom";

function App() {
  return (

    <div className="App">
      <Header />
      <div className="mainWindow">
        <Routes>
          <Route path='/' element></Route>
        </Routes>
      </div>
       
    </div>
  )
}

export default App;
